import "./Form.css";
import GetTable from "./GetTracTable";
import { DownloadTableExcel } from "react-export-table-to-excel";
import { useRef } from "react";
function Form() {
  const tableRef = useRef(null);

  return (
    <div className="containor">
      <DownloadTableExcel
        filename="Tableau de tracabilité"
        sheet="Tableau de tracabilité"
        table="hello"
      >
        <button> Export excel </button>
      </DownloadTableExcel>
      {/* <table ref={tableRef} id="tabletable">
        <GetTable data={data} />
      </table> */}

      <table ref={tableRef} id="hello">
        <tbody></tbody>
        <tr>
          <th>Company</th>
          <th>Contact</th>
          <th>Country</th>
        </tr>
        <tr>
          <td>Alfreds Futterkiste</td>
          <td>Maria Anders</td>
          <td>Germany</td>
        </tr>
        <tr>
          <td>Centro comercial Moctezuma</td>
          <td>Francisco Chang</td>
          <td>Mexico</td>
        </tr>
      </table>
    </div>
  );
}

export default Form;
